#!/usr/bin/python

import unittest
import ReverseComplement


class ReverseComplementTest(unittest.TestCase):

    def testData1(self):
        input = 'AAAACCCGGT'
        expect = 'ACCGGGTTTT'
        self.assertEqual(expect, ReverseComplement.ReverseComplement(input))

    def testData2(self):
        input = ''
        expect = ''
        self.assertEqual(expect, ReverseComplement.ReverseComplement(input))

    def testData3(self):
        input = 'GATTACA'
        expect = 'TGTAATC'
        self.assertEqual(expect, ReverseComplement.ReverseComplement(input))

    def testData4(self):
        input = 'TTGTGTC'
        expect = 'GACACAA'
        self.assertEqual(expect, ReverseComplement.ReverseComplement(input))


class StartPositionPatternMatchTest(unittest.TestCase):

    def testData1(self):
        genome = 'GATATATGCATATACTT'
        pattern = 'ATAT'
        expect = [1, 3, 9]
